import React, { Component } from 'react';
import Car from "./Car/Car";
class App extends Component {

  state = {
    cars: [
      {name: 'Ford', year: 2018},
      {name: 'Audi', year: 2012},
      {name: 'BMW', year: 2020},
    ]
  };



  render() {
    return (
        <div className="App">
          {
            this.state.cars.map(function (car) {
              <Car name={car.name} year={car.year}  />
            })
          }
        </div>
    )
  }
}

export default App;
